MongoDB - query collection to return all docs with latest version<p>I am fairly new to Mongo, and I have the following task:</p>

<p>Running Mongo 3.4.2.</p>

<p>Collection:</p>

<pre><code>[
  {
    "docID": "aaa111",
    "version": 1,
    "somefield1": "abc"
  },
  {
    "docID": "aaa111",
    "version": 2,
    "somefield1": "abc",
    "somefield2": "abc"
  },
  {
    "docID": "bbb222",
    "version": 1,
    "somefield1": "abc",
    "somefield2": "abc"
  },
  {
    "docID": "bbb222",
    "version": 2,
    "somefield1": "abc",
    "somefield3": "abc"
  },
  {
    "docID": "bbb222",
    "version": 3,
    "somefield2": "abc",
    "somefield3": "abc"
  }
]
</code></pre>

<p>In other words, documents with the same docID could have different "schema". </p>

<p>What I need the query of this collection to return are documents having the latest version, with all the fields of those specific documents.</p>

<p>Here is what the query output based on the above collection should look like:</p>

<pre><code>[
  {
    "docID": "aaa111",
    "version": 2,
    "somefield1": "abc",
    "somefield2": "abc"
  },
  {
    "docID": "bbb222",
    "version": 3,
    "somefield2": "abc",
    "somefield3": "abc"
  }
]
</code></pre>

<p>I have been trying to use the $aggregate operator as follows:</p>

<pre><code>db.collection.aggregate(
[
    { $sort: { docID: 1, version: 1 } },
    { $group:
        {
            _id: "$docID",
            latestVersion: { $last: "$version" }
        }
    }
 ]
)
</code></pre>

<p>but this just returns 2 fields, docID and the latest version.  </p>

<p>I then tried using the $in operator to select from that collection using find(), where $in would accept the above query, however, one issue is that $in expects and array, and secondly, I need to select the documents where docID and version match to the results of the subquery.</p>

<p>How do I get all the fields of the documents having the docID and the latest version?</p>

<p>Any help is appreciated.</p>

<p>Thanks in advance.</p>

