Why does Spring Data MongoDB reject a field name containing a $ in an aggregation pipeline?<p>When creating an aggregate query on MongoDB using Spring Data's <strong><em>ProjectionOperation</em></strong> class, using field with the <strong>"$"</strong> (for example 'test$') character causes an <strong>IllegalArgumentException</strong></p>

<p>Verifying the spring data mongodb sources, I noticed that in the constructor of the <strong>AggregationField</strong> class a cleanup of the field name is performed. <a href="https://raw.githubusercontent.com/spring-projects/spring-data-mongodb/2.2.0.M1/spring-data-mongodb/src/main/java/org/springframework/data/mongodb/core/aggregation/Fields.java" rel="nofollow noreferrer">Fields.java Class</a></p>

<pre><code>private static String cleanUp(String source) {

    if (Aggregation.SystemVariable.isReferingToSystemVariable(source)) {
        return source;
    }

    int dollarIndex = source.lastIndexOf('$');
    return dollarIndex == -1 ? source : source.substring(dollarIndex + 1);
}
</code></pre>

<p>The nomenclature of the fields in MongoDB discourage the use of the "$" character or this is a Spring Data problem?</p>

