Why mongoose middleware "pre" remove with { query: true } is not called?<p>I'm a bit stuck on this problem. 
I have read all the mongoose documentation about middleware and some stackoverflow issue and was unable to find-out how to solve my problem without duplicating queries (find then remove).</p>

<p>Normally, pre middleware on remove will not fire when call from Model and not from document. But according with <a href="https://mongoosejs.com/docs/middleware.html#naming" rel="nofollow noreferrer">the doc</a>, if I add {query: true}, my function will be called from model query.</p>

<p>I use the latest monngoose version (5.4.16)</p>

<p>Here is my code.</p>

<pre><code>let mySchema= new mongoose.Schema({
  name: String,
  comment: String
}, { usePushEach: true });

mySchema.pre('remove', { document: true }, function() {
  console.log('remove document');
});
mySchema.pre('remove', { query: true }, function() {
  console.log('remove');
});
const MyModel = mongoose.model('MyModel', mySchema);
</code></pre>

<p>And the call here</p>

<pre><code>MyModel.deleteOne({ _id: modelId }, (errorRm) =&gt; {
  if (errorRm) {
    return res.json({ success: false, message: `${errorRm.message}` });
  }
    return res.json({ success: true, message: 'Model successfully removed' });
  });
</code></pre>

<p>The model is successfully removed but nothing is logged from the "pre" functions...</p>

<p>Any help would be welcomed.</p>

