<p>A for loop doesn't work due to node async nature. </p>

<pre><code>const saveMany = (req, res, obj, data) =&gt; {
    let saves = [];
    if (data.frequency === 'monthly') {
         let i = 0;
         for (let i = 0; i &lt; data.reccuring_length; i++) {
            const newEntry = new obj(data);
            if (i != 0) newEntry.created_date.addMonths(1) //using datejs
            newEntry.save((err, entry) =&gt; {
                if (err) {
                    return res.status(400).send({
                        message: err
                    });
